        val tokens = detector.getTokens(file.readText())
        tokens.forEach { tokenMatch ->
            println("Token found ${tokenMatch.toString()}")
        }
    }catch (e: Exception){
        println("Se ecnontro el siguiente error: ")
        println(e.localizedMessage)
    }






}